import React, { Component } from 'react'
import './../../styles/absensi.css'

import Header from '../global/header'
import MenuBar from '../global/navbar'

import { Table, TabContent, Card, TabPane, Nav, NavItem, NavLink } from 'reactstrap'
import classnames from 'classnames'

export default class Absensi extends Component {
  constructor(props) {
    super(props);
    this.state = { value: 'coconut' };

    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(event) {
    this.setState({ value: event.target.value });
  }
  handleSubmit(event) {

  }
  render() {
    return (
      <div className="absensi">
        <Header></Header>
        <MenuBar></MenuBar>
        <br /><br />
        <div className="content">
          <div className="col-9 row left-content">
            <div className="col-3">Kiri banget</div>
            <div className="col9">Tengah banget</div>
          </div>
          <div className="col-3 center-content">
            <div className="col-12">
              <div className="card">
                Pertama
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
